import Login from "./components/login.js";
import { Route, Routes } from 'react-router-dom';
import Home from "./components/home.js";


function App() {
  return (
    <div className="App">
      <Routes>
      <Route path='/login' element={<Login/>}/>
        <Route path='/login' element={<Login/>}/>
      </Routes>
      <Home />
    </div>
  );
}

export default App;
